import React from 'react'
import { Link } from 'react-router-dom'

import styles from './MediaCard.module.css'

const MediaCard = ({post}) => {
    return (
        <Link to={`/post/${post._id}`} >
            <div className={styles.image_wrapper}>
                <img src={post.avatar} />
            </div>
        </Link>
    )
}

export default MediaCard
